import React, { Component } from "react";
import { Form, Input, Select,Row, Table, Col,Card,Modal,Drawer,Button,Icon} from "antd";

import ModalDialog from "./ModalDialog";
const CollectionCreateForm = Form.create({ name: "form_in_modal" })

class Reactjs extends Component{
 state = {
   isOpen:false

 }
 showModal = () => {
    this.setState({ modalVisible: true });
  };

  handleCancel = () => {
    this.setState({ modalVisible: false });
  };



  saveFormRef = formRef => {
    this.formRef = formRef;
  };

  showDrawer = () => {
    this.setState({
      drawerVisible: true
    });
  };

  onClose = () => {
    this.setState({
      drawerVisible: false
    });
  };
render(){
const { visible, onCancel, onCreate, form } = this.props;
const columns = [{title: 'Order Number',dataIndex: 'oNumber', key: 'oNumber', }]
const data = [{ key: '1',oNumber: 'DVO524',}]
   return(

   <div className="Reactjs">
  <button onClick={(e) => this.setState({isOpen:true})}> Table View</button>
  <CollectionCreateForm
          wrappedComponentRef={this.saveFormRef}
          visible={this.state.modalVisible}
          onCancel={this.handleCancel}
          onCreate={this.handleCreate}
        />

    <ModalDialog isOpen={this.state.isOpen}  onClose={(e) => this.setState({isOpen:false })} >
    <Modal visible={visible}
      title="Create a new collection"
      okText=""
      onCancel={onCancel}
      onOk={onCreate}
    >
     <Table columns={columns} dataSource={data} />
     </Modal>
    </ModalDialog>

   </div>
);
}
}

export default Reactjs;
